    <style> html,
        body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100%;
            overflow: hidden;
            font-family: 'Segoe UI', sans-serif;
        }

        svg {
            width: 100vw;
            height: 100vh;
            display: block;
        }

        .score-container {
            width: 100%;
            height: 100%;
            background: transparent;
            border-radius: 8px;
            display: flex;
            flex-direction: column;
            justify-content: space-evenly;
            align-items: center;
            padding: 5%;
            box-sizing: border-box;
            color: #fff;
        }

        .score-title {
            font-size: 60px;
            margin-bottom: 10px;
        }

        .score-display {
            font-size: 80px;
            font-weight: bold;
            color: #ffe47b;
            margin: 10px 0;
        }

        .score-percentage {
            font-size: 55px;
            color: #75ff1c;
            margin-bottom: 10px;
        }

        .score-message {
            font-size: 40px;
            margin-bottom: 10px;
            text-align: center;
        }

        /* Zone clavier */
        .zone-interactive:hover {
            cursor: pointer;
            opacity: 0.8;
        }
